cặp A, B, C, App, Bpp, Cpp;

A = (0,2);
B = (-3,2);
C = (-3,0);
Ứng dụng = xoay (90) * phản xạ ((0,0), (1,0)) * (A);
Bpp = xoay(90)*reflect((0,0),(1,0))*(B);
Cpp = xoay (90) * phản xạ ((0,0), (1,0)) * (C);

rút ra (A--B--C---chu kỳ);
vẽ (App--Bpp--Cpp--cycle);
hòa ((-3,5,0)--(3,5,0));
